import React from "react";
import { FormControl, NativeSelect } from "@material-ui/core";

import "./pick.css";

const Picker = () => {
  return (
    <div className="form_control">
      <FormControl>
        <NativeSelect>
          <option value="global">Global</option>
        </NativeSelect>
      </FormControl>
    </div>
  );
};

export default Picker;
